          <img src={Sand} alt="" />
        </div>
        <div className="w-64 mx-auto mt-4 space-y-2">
          <p className="text-blue-300 text-2xl">
            Sand Crawler
          </p>
          <p className="text-gray-400 text-lg">
            C$140000
          </p>
          <p className="text-gray-600 text-3xl">
            <span className="text-blue-800" >Company:</span> Trash-Nomade
          </p>
        </div>
      </div>
    </div>
  );
}

export default App;
